import React from "react";
import { isMobile } from 'react-device-detect';
import Estilo from "../Hojas de Estilos/Menu.css";

import ItemMenu from "./ItemMenu";
function Menu({ activo }){
        const definirMenu = ()=>{
            let clase;
            if(isMobile){
                clase=activo ? "menu activo" : "menu";
            }else{
                clase="menu laptop";
            }
            return clase;
        }
    return(
        <div className={definirMenu()}>
                <ItemMenu>
                    Inicio
                </ItemMenu>
                <ItemMenu>
                    Sobre Nosotros
                </ItemMenu>
                <ItemMenu>
                    Experencias
                </ItemMenu>
                <ItemMenu>
                    Contactanos
                </ItemMenu>
        </div>
    );
}
export default Menu;
